dict.getLevelId=function(data)
{
  if(data.exam_id)return this.EXAMS[data.exam_id].LEVELID;
  var time=data._SUBJECT+'-'+data._YEAR+'-'+data._MONTH;
  for(var p in this.EXAMS)
  {
    if(this.EXAMS[p].GROUPID==data._GROUP)return this.EXAMS[p].LEVELID;
    if(this.EXAMS[p].TIME==time)return this.EXAMS[p].LEVELID;
  }
  console.log('没找到报考级别, 组:'+data._GROUP+', 数据:'+time);
};
dict.getLevelName=function(data)
{
  try
  {
    var bkjb=data.bkjb,type=1;
    if(!bkjb)
    {
      type=0;
      bkjb=data.BKJB||data.TESTTYPE||data.JB;
    }
    return this.LEVELS[this.getLevelId(data)][bkjb][type];
  }catch(e)
  {return e;}
};
dict.getScoreName=function(data)
{
  var arr=[['不合格','不及格'],['合格','及格'],['良好','良好'],['优秀','优秀']],v=data.cjdd||data.ZCJ;
  if(data.exam_id)data._GROUP=dict.EXAMS[data.exam_id].GROUPID;
  var type=0;
  if(window.node&&node.id==220145490){type=1;}
  //else if((data._GROUP=='100'||data._GROUP=='2GtSbktMd5TVhp95yzc2RF')&&v==2)v=1;
  //else if(data._GROUP=='720'||'2SGWSxv6t5nrujpRMlUDZe')
  arr=this.SCORES[this.getLevelId(data)]||arr;
  if(!arr[v])return v;
  return arr[v][type];
};